import RoadmapProgress from 'react-roadmap-progress';
import {UserCard} from 'react-ui-cards';

const milestones = [
  {
      title: 'Phase 1',
      version: '0.0.1',
      description: 'Just getting started...',
      complete: true,
  },
  {
      title: 'Phase 2',
      version: '1.0.0',
      description: (
          <div>
              <h2>Marketing</h2>
              <p>Gaming</p>
          </div>
      ),
      complete: true,
  },
];

export const Founder = () => <UserCard
float
href ='https://www.linkedin.com/in/andrew-czarnecki-7a7371190/'
header = {sibmLogo}
avatar = {drew}    
name = 'Andrew Czarnecki'
positionName = 'Founder & CTO'
stats = {[
  {
    name: 'Engineering',
    value: "Field"
  },
  {
      name: 'Years',
      value: '4'
  }
]}
/>

export const Founder2 = () => <UserCard
float
href=''
header=  {tokenLogo} // 'https://i.imgur.com/w5tX1Pn.jpg'
avatar={drago}      //'https://i.imgur.com/uDYejhJ.jpg'
name='Joseph Kasneci'
positionName=' Co-Founder'
stats={[
    {
        name: 'Insurance',
        value: "Field"
    },
    {
        name: 'Years',
        value: '3'
    }
]}
/>

